function ord(r){return r.charCodeAt(0)}function chr(r){return String.fromCharCode(r)}function range(r,n,t){var e=[];if("undefined"==typeof n&&(n=r,r=0),"undefined"==typeof t&&(t=1),t>0&&r>=n||0>t&&n>=r)return[];for(var u=r;t>0?n>u:u>n;u+=t)e.push(u);return e}function chunks(r,n){for(var t=range(0,r.length,n),e=[],u=0;u<t.length;u++)e.push(r.slice(t[u],t[u]+n));return e}function toHex(r,n,t,e){return hex=(256+r).toString(16).substr(1)+((1<<24)+(n<<16)|t<<8|e).toString(16).substr(1),hex.substr(0,hex.length-2).toUpperCase()}String.prototype.mult=function(r){return new Array(r+1).join(this)};